    sim: 0.5607843399047852,
    url: 'http://thehill.com/policy/transportation/aviation/383548-southwest-jet-makes-emergency-landing-in-philadelphia',
    title: 'Southwest jet makes emergency landing in Philadelphia',
    body: 'A Southwest Airlines plane bound for Dallas on Tuesday was forced to make an emergency landing in Philadelphia after a broken window caused the aircraft to depressurize, NBC10 reported.\n\nAccording to the report, a portion of the engine flew into and broke a window, causing a woman on the plane to be partly pulled out of the aircraft.\n\n"One passenger, a woman, was partially ... was drawn out towards the out of the plane ... was pulled back in by other passengers," Todd Baur, a father of one of the plane\'s passengers, told the NBC affiliate.\n\nThe woman was reportedly sent to a hospital in Philadelphia after the plane landed at Philadelphia International.\n\nAn ABC affiliate in Houston obtained a photo showing the aircraft\'s damaged engine after the landing.\n\nWATCH LIVE: Crews on the scene after a @SouthwestAir plane made an emergency landing. This photo is from a passenger who is thanking the #Southwest crew for getting them on the ground safely. https://t.co/ftVblBMc50 pic.twitter.com/2JUnbFfKnP -- ABC13 Houston (@abc13houston)\n\nApril 17, 2018\n\nThe plane had taken off from New York\'s LaGuardia airport on Tuesday morning.',
