  title: 
   { eng: 'F.T.C. Investigating Facebook in Use of Personal Data by Firm Tied to Trump',
     fra: 'L\'affaire Cambridge Analytica plonge Facebook dans une crise historique',
     spa: 'Facebook est enfrentando una crisis existencial con el escndalo de Cambridge Analytica',
     rus: '     $6 ',
     por: 'Escndalo coloca Facebook na mira dos governos dos EUA e Reino Unido',
     zho: ' Facebook ',
     ita: 'Facebook: Kogan, io capro espiatorio, tutti sapevano tutto  - Internet e Social',
     cat: 'El fundador de Facebook, cridat a declarar al Parlament britnic',
     ukr: '  :  Cambridge Analytica   ' },
  summary: 
   { eng: 'The Federal Trade Commission has opened an investigation into whether Facebook violated an agreement with the agency on data privacy, after reports that information on 50 million users was improperly obtained by the political consulting firm Cambridge Analytica, according to a person with knowledge of the inquiry.\n\nThe investigation, started in recent days, adds to the mounting pressure against Facebook in the United States and in the United Kingdom about its handling of the data. Cambridge Analy',
     fra: 'Aux Etats-Unis, les responsables politiques des deux bords rclament que le PDG du rseau social s\'explique devant le Congrs, aprs les rvlations sur l\'utilisation des donnes personnelles.\n\nFacebook est en train d\'affronter l\'une des pires crises de son histoire. De virulentes critiques fusent des deux cts de l\'Atlantique  l\'encontre du rseau social, trois jours aprs les rvlations du Guardian et du New York Times au sujet de Cambridge Analytica, une entreprise ayant jou',
     spa: 'El escndalo de Cambridge Analytica le ha ocasionado un dao inmenso a la marca, creen fuentes en toda la compaa. Ahora harn un esfuerzo herculano para restaurar la confianza del pblico en el compromiso de Faceboook con la privacidad y la proteccin de datos, dicen ellos. Observadores externos piensan que la regulacin se ha vuelto ms probable de repente y el presidente ejecutivo, Mark Zuckerberg, parece haber desaparecido en accin.\n\nEl escndalo tambin resalta un problema que ',
     rus: ' Facebook   19   $6 .          \n\n  CNBC,  Facebook   19    8%.        ,   Cambridge Analytica, ',
     por: 'Nesta semana, o Facebook tem sido atingido por todos os lados aps a revelao de que uma empresa de marketing chamada Cambridge Analytica teve acesso indevido a dados de 50 milhes de usurios. Agora, a rede social est na mira dos governos dos Estados Unidos e do Reino Unido.\n\nSegundo fontes da agncia Bloomberg, a Comisso Federal do Comrcio dos EUA (FTC, na sigla em ingls) abriu um inqurito para apurar se o Facebook rompeu com um acordo estabelecido em 2011 que previa certos cui',
     zho: ' Facebook  Facebook  search encrypt  98  Facebook  Facebook \n\n',
     ita: 'LONDRA - "Mi usano come capro espiatorio, sia Facebook sia Cambridge Analytica", ma la verit  che tutti sapevano tutto e tutti "ritenevamo di agire in modo perfettamente appropriato" dal punto di vista legale. Alexander Kogan, accademico americano figlio d\'espatriati sovietici e docente di psicologia a Cambridge, non ci sta rimanere con il cerino in mano sullo scandalo del momento. E replica dai microfoni di Bbc Radio 4. E\' lui, attraverso una sua app, l\'uomo che ha raccolto ed elaborato i da',
     cat: 'El fundador de Facebook, Mark Zuckerberg ha estat cridat oficialment aquest dimarts pel parlament britnic perqu acudeixi a declarar sobre l\'s de dades personals de 50 milions d\'usuaris de la coneguda xarxa social per part de la companyia d\'anlisi poltica Cambridge Analytica, amb seu central a Londres per fundada l\'any 2013 per un geners donant del Partit Republic, Robert Mercer, i per l\'ideleg de la campanya presidencial de Donald Trump, Steve Bannon. Informacions publicades aqu',
     ukr: '       \n\n          Cambridge Analytica         .      .\n\n  Facebook ' },
