  eventDate: '2018-03-25',
  title: 
   { eng: 'Deadly fire in Russian shopping mall kills 64, many of them children',
     zho: '64 ',
     deu: 'Feuer in Einkaufszentrum: 64 Tote bei Brand - Wachmann soll Alarm ausgeschaltet haben - WELT',
     spa: 'Al menos 37 muertos tras un incendio en un centro comercial en Rusia',
     fra: 'Incendie meurtrier en Sibrie : Poutine dnonce une "ngligence criminelle"',
     por: '\'Estamos queimando. Amo vocs\', escreveu vtima de incndio em shopping center na Rssia',
     tur: 'Rusya\'da facia! AVM\'de yangn kt: En az 48 l!',
     rus: '      ',
     cat: 'La rbia per la negligncia al centre comercial encn els nims de Sibria',
     slv: 'Smrtne rtve v poaru v nakupovalnem centru v Sibiriji' },
  summary: 
   { eng: 'MOSCOW -- At least 64 people, many of whom are believed to be children, perished in the Siberian city of Kemerovo on Sunday as a massive fire swept through a crowded shopping center.\n\nAnother 40 more victims were treated on site, and at least 10 others have been hospitalized, according to Russia\'s Ministry of Health. Rescuers are also still searching for almost 60 missing people -- most of them children. Kemerovo is nearly 2,000 miles east of Moscow.\n\nSunday was the first day of a week-long schoo',
     zho: '\n\nKemerovo32564\n\n10\n\n""\n\n\n\n',
     deu: 'Sie wollten einen schnen Nachmittag im Kino verbringen und freuten sich ber den Start ihrer Ferien. Am Sonntag besuchten zahlreiche Kinder mit ihren Eltern ein Kino im sibirischen Kemerowo. Doch dann brach in dem Einkaufszentrum, in dem sich das Kino befand, ein Feuer aus. 64 Menschen starben in den Flammen. Nun haben Ermittler den Wachmann des Einkaufszentrums im Visier. Er soll den Feueralarm deaktiviert haben.\n\nDer Mann habe den Alarm ausgeschaltet, nachdem er ein Signal ber Feuer im Geb',
     spa: 'Al menos 37 personas murieron el domingo en un incendio que destruy un centro comercial en la ciudad siberiana de Kemerovo, en el sudeste de Rusia.\n\nFuncionarios de emergencia locales informaron que otras tres decenas de personas estn desaparecidas y que entre ellas podra haber nios.\n\nEl incendio comenz en el cuarto piso del edificio Winter Cherry y muchas de las vctimas estaban en un cine.\n\nUn video publicado en las redes sociales muestra que varias personas saltaban de las ventanas ',
     fra: 'Vladimir Poutine a dnonc mardi l\'incendie meurtrier qui a fait au moins 64 morts dans un centre commercial de Sibrie.\n\nPour le prsident russe, les 64 personnes dont 41 enfants qui ont pri dans l\'incendie d\'un centre commercial  Kemerovo, en Sibrie, sont mortes " cause de ngligence criminelle, de laisser-aller", selon des propos retransmis mardi par le Kremlin. La veille, les autorits russes ont dnonc de graves ngligences et des violations des normes de scurit.\n\nLes e',
     por: 'Adolescentes \'desaparecidas\' aps tragdia mandaram mensagens a parentes\n\npor O Globo / Agncias internacionais\n\n26/03/2018 12:48 / Atualizado 26/03/2018 13:09\n\nMOSCOU -- Adolescentes citados em uma lista de pessoas desaparecidas que est sendo divulgada pela imprensa russa aps o incndio no shopping Winter Cherry, em Kemerovo, na Rssia, entraram em contato com suas famlias durante os momentos de pnico. Pelo menos 64 pessoas morreram em decorrncia das chamas que destruram o centr',
     tur: 'Rusya\'nn orta gney kesiminde bulunan Kemerovo ehrinde bir alveri merkezinde yangn kt. Son dakika habere gre, korkun yangnda en az 48 kii ld. Olayda 50\'den fazla kiinin yaraland ve onlarca kiinin kayp olduu bildirildi.\n\nRusya Soruturma Komitesi\'nden yaplan aklamada, ehir merkezinde bulunan alveri merkezinde kan yangnda l saysnn 48\'e ulat kaydedildi. Yerel basnda kan haberlere gre 50\'den fazla kiinin yar',
     rus: '           ,  "         ".         ,     27 , " ',
     cat: 'La rbia per les nulles mesures de seguretat i la falta d\'informaci ha escalfat els nims entre els familiars de les vctimes de l\'incendi que diumenge va destruir un centre comercial de la ciutat siberiana de Kmerovo. Centenars de persones han sortit als carrers amb fotografies de les vctimes per mostrar el seu enuig i exigir dimissions pels responsables de la tragdia. A causa del foc van morir 64 persones, de les quals 41 sn menors d\'edat, segons les llistes difoses aquest dimart',
     slv: 'Moskva, 25. marca (STA) - V nakupovalnem centru industrijskega mesta Kemerov v Sibiriji je zagorelo. Umrle so najmanj tiri osebe, od tega trije otroci, 26 ljudi so morali odpeljati v bolninico, so danes po poroanju francoske tiskovne agencije AFP sporoile tamkajnje oblasti. Pristojne oblasti domnevajo, da je poar izbruhnil v predelu nakupovalnega sredia, kjer sta kinematograf in igrie za otroke. Poar naj bi se raziril na skupno ve kot tiso kvadratnih metrov. V gaenju' },
