  title: 
   { eng: 'China\'s \'space dream\': A long walk to the moon',
     zho: '"" ',
     fra: 'Une station spatiale chinoise va s\'craser sur Terre ce week-end: existe-t-il un risque?',
     spa: 'Laboratorio espacial chino Tiangong-1 cae a la Tierra',
     deu: 'Chinas Raumstation "Tiangong-1" abgestrzt und verglht',
     por: 'Estao espacial chinesa deve cair nas prximas horas na Terra',
     tur: 'stanbul\'u da tehdit eden in uzay istasyonu Tiangong-1 parampara oldu! - Teknoloji Haberleri',
     ita: 'La Stazione spaziale cinese rientrata sul Pacifico VIDEO - Scienza & Tecnica',
     slv: 'Nebeka palaa zgorela ob vstopu v ozraje' },
  summary: 
   { eng: 'The plunge back to Earth of a defunct Chinese space laboratory will not slow down Beijing\'s ambitious plans to send humans to the moon.\n\nThe Tiangong-1 space module, which crashed was intended to serve as a stepping stone to a manned station, but its problems highlight the difficulties of exploring outer space.\n\nBut China has come a long way in its race to catch up with the United States and Russia, which have lost spacecraft, astronauts and cosmonauts over the decades.\n\nChina\'s "taikonauts" have',
     zho: '\n\n42""42815\n\n\n\n""20112022',
     fra: 'La station Tiangong-1 doit entrer dans l\'atmosphre terrestre dimanche soir au plus tt, selon les spcialistes. L\'incertitude demeure quant  la possibilit de voir des dbris atteindre la surface de la plante. Auquel cas, le sud de la France, la Corse, et certains territoires d\'outre-mer feraient partie des zones potentiellement concernes.\n\nLa fin de son voyage est prvue pour ce week-end. La station spatiale chinoise Tiangong-1 s\'apprte  effectuer une rentre non contrle da',
     spa: '(CNN) - El laboratorio espacial Tiangong-1 de China reingres a la atmsfera de la Tierra alrededor de las 8:15 am el lunes hora de Beijing (domingo 8:15 pm ET) y cay al Pacfico sur, dijo la agencia espacial china en un comunicado.\n\nEl comunicado dice que "la mayora de partes se quemaron en el proceso de reingreso".\n\nTiangong-1 es llamado el "Heavenly Palace" (Palacio Celestial) y mide de 12 metros de largo.\n\nMIRA: Astrnomo aficionado descubre un satlite de la NASA que haba estado p',
     deu: 'Es kam wie erhofft: Die auer Kontrolle geratene chinesische Raumstation "Tiangong-1" strzte auf die Erde ohne groen Schaden anzurichten. Sie trat ber dem Sdpazifik in die Erdatmosphre ein.\n\nDie chinesische Raumstation "Tiangong-1" ist auf die Erde gestrzt. Das acht Tonnen schwere Weltraumlabor sei dabei "grtenteils" verglht, teilte die chinesische Raumfahrtbehrde CMSEO mit.\n\nDie gut zehn Meter lange "Tiangong" (zu deutsch: Himmelspalast) sei um 08.15 Uhr Pekinger Zeit (02.15',
     por: 'Tiangong-1, o Palcio Celestial, foi lanada em 2011 e est desabitada desde 2013 China Manned Space Agency\n\nA Agncia Espacial Europeia (ESA, na sigla em ingls) reafirmou, em seu boletim deste domingo (1), que a estao espacial chinesa Tiangong-1, que est em queda descontrolada no espao, deve reentrar na atmosfera terrestre nas prximas horas.\n\nA reentrada  prevista, segundo o ltimo boletim, desde a madrugada deste domingo at as primeiras horas da manh da segunda-feira (2',
     tur: 'in nsanl Uzay Mhendislii Brosu\'ndan (CMSEO) yaplan aklamada, Pazartesi gece yars itibariyle Tiangong-1\'in atmosfere yeniden giri yapaca belirtilmiti.\n\nUzay aracnn debilecei yerler arasnda Trkiye de bulunuyordu. talya, spanya, Japonya, Kore de uzay aracnn infilak edebilecei yerler arasndayd.\n\n2013\'te grev sresi bitmiti\n\nin\'in 2011\'de frlatt 8,5 ton arlndaki Tiangong-1 (Gk Saray) isimli uzay istasyonu 2013\'te g',
     ita: 'Dopo 2.375 giorni e 21 ore in orbita, la stazione spaziale cinese Tiangong 1 ha concluso la sua caduta libera sul Pacifico meridionale, rientrando nell\'atmosfera prima di poter tornare a \'salutare\' l\'Italia. Il suo nome significa \'Palazzo celeste\' e la sua storia  stata seguita da telescopi e radar di almeno 12 agenzie spaziali e centri di ricerca di tutto il mondo.\n\nIl video del rientro nel 2008 della prima navetta automatica Atv, dell\'Agenzia Spaziale Europea, confrontabile per dimensioni all',
     slv: 'Nekaj manjih delcev pa je padlo v ocean okoli 100 kilometrov severozahodno od Tahitija.\n\nVeina odsluene kitajske vesoljske postaje Tiangong-1 je zgorela ob vstopu v Zemljino ozraje nekje sredi junega Pacifika, so po poroanju Reutersa sporoile kitajski oblasti. Najprej so sicer predvideli, da bi postaja Zemljino ozraje vstopila blizu brazilske obale nad junim Atlantikom.\n\nTudi amerika postaja, ki nadzoruje in sledi neznane objekte v zemeljski orbiti, je poroala, da je ob pomo' },
