  eventDate: '2018-03-22',
  title: 
   { eng: 'Zlatan Ibrahimovic has left Manchester United',
     fra: 'Officiel : Manchester United annonce le dpart de Zlatan Ibrahimovic !',
     spa: 'LA Galaxy confirma traspaso de Zlatan Ibrahimovic',
     deu: 'Transfermarkt: Zlatan Ibrahimovic verlsst Manchester United',
     rus: '   "- "',
     por: 'Ao lado de "leo", Ibrahimovic  anunciado oficialmente no Los Angeles Galaxy',
     ita: 'Ibrahimovic nella MLS, ecco l\'annuncio',
     tur: 'Ibrahimovic LA Galaxy\'ye transferini ilgin bir ekilde duyurdu',
     hrv: 'Ibrahimovi se oprostio od navijaa Uniteda' },
  summary: 
   { eng: 'Zlatan Ibrahimovic has left Manchester United after two seasons with the club.\n\nThe veteran Swedish striker will is set to MLS outfit LA Galaxy as he prepares to bring down the curtain on a glorious career.\n\nUnited issued a statement on their website on Thursday afternoon, saying: "Manchester United confirms that it has agreed to the termination of Zlatan Ibrahimovic\'s contract with immediate effect.\n\n"Everyone at the club would like to thank Zlatan for his contribution to the team since his arri',
     fra: 'Manchester United vient de publier un communiqu sur son site officiel pour annoncer que Zlatan Ibrahimovic venait de rsilier son contrat. Le Sudois est donc dsormais libre de s\'engager pour le club de son choix. La tendance est  un dpart vers la MLS, o Los Angeles l\'attend  bras ouverts.\n\nC\'tait dans l\'air, c\'est dsormais officiel : Zlatan Ibrahimovic (36 ans) quitte Manchester United. Le club mancunien vient de publier un communiqu officiel sur son site pour annoncer la nou',
     spa: 'Los Angeles (AFP) -\n\nZlatan Ibrahimovic y Los Angeles Galaxy confirmaron el traspaso de la estrella sueca en un anuncio publicado en el diario Los Angeles Times.\n\n"Querido Los Angeles, eres bienvenido", dice el enigmtico anuncio de una pgina, junto a la firma de Ibrahimovic y el logo del Galaxy.\n\nEn tanto, una foto del jugador de 36 aos de edad luciendo la casaca del LA Galaxy aparece encima de una nota separada en la primera pgina de la seccin de Deportes del diario.\n\nEl traspaso de Ib',
     deu: 'Zlatan Ibrahimovic spielt nicht mehr bei Manchester United. Der Vertrag des schwedischen Torjgers wird vorzeitig aufgelst.\n\nSuperstar Zlatan Ibrahimovic hat seinen Vertrag beim englischen Rekordmeister Manchester United mit sofortiger Wirkung aufgelst und steht nun wohl vor einem Wechsel in die amerikanische Profiliga MLS. United besttigte die Beendigung der Zusammenarbeit mit dem schwedischen Ausnahmestrmer am Donnerstag.\n\n"Auch groartige Dinge kommen zu einem Ende, es ist Zeit, nach',
     rus: '"- "         .\n\n     9 .\n\n" ,       33 ,     ,        ',
     por: 'Com a companhia de um "leo", Zlatan Ibrahimovic foi anunciado oficialmente pelo Los Angeles Galaxy em um vdeo inusitado nas suas redes sociais. O atacante sueco, de 36 anos, vai ter um contrato de dois anos. Os valores no foram divulgados, mas a imprensa local especula que Ibra receber cerca de 1,2 milho de euros por ano.\n\n+ Ibrahimovic compra pgina de jornal e brinca com sua chegada aos EUA\n\nEm nota oficial, o Galaxy disse que a inteno de trazer Ibra comeou h trs anos, quan',
     ita: 'Banalit e Zlatan Ibrahimovic: un binomio introvabile nella carriera dell\'attaccante svedese. Che per annunciare il suo trasferimento nella Major League Soccer, la prima serie del calcio statunitense, ha optato per un\'idea singolare: acquistare una pagina di giornale con sfondo completamente bianco e firmarla. A modo suo.\n\nZlatan Ibrahimovic has taken out a full page advert in the @latimes announcing his arrival at LA Galaxy. Classic Zlatan. pic.twitter.com/TeFXM2De7e -- Dale Johnson (@DaleJohns',
     tur: 'ngiltere Premier Lig ekiplerinden Manchester United ile szlemesini fesheden sveli yldz golc Zlatan Ibrahimovic, kendisini destekleyenlere teekkr etti. Zlatan Ibrahimovic, ABD birinci futbol ligi MLS ekiplerinden Los Angeles Galaxy\'ye transferini ilgin bir ekilde duyurdu.\n\nSosyal paylam sitesi Twitter ile Instagram hesaplarndan aklamada bulunan 36 yandaki golc, sevenlerine veda ederek, "Gzel eylerin de bir sonu var ve harika iki sezonun ardndan Manches',
     hrv: 'Zlatan Ibrahimovi je nakon manje od dvije godine napustio Manchester United. Jedan od najveih klubova svijeta danas je slubeno potvrdio rastanak sa vedskim napadaem, tri mjeseca prije isteka ugovora.\n\nIbrahimovi je na Old Trafford stigao 2016. godine bez odtete iz PSG-a, bio je najbolji igra Uniteda u prvoj sezoni koju nije zavrio zbog teke ozljede prolog travnja. Nakon operacije i viemjesenog oporavka vratio se nogometu u prosincu, ali nova ozljeda sprijeila je njegov' },
