  eventDate: '2018-04-03',
  title: 
   { eng: 'Putin, Erdogan and Rouhani to discuss Syrian crisis in Ankara ',
     deu: 'Putin in Ankara: Russland und Trkei bauen strategische Kooperation in Wirtschaft und Militr aus',
     rus: '      ""',
     fra: 'L\'Iran, la Turquie et la Russie main dans la main face  l\'Occident',
     spa: 'Qu hay detrs de la ayuda de Rusia en la construccin de la primera central nuclear de Turqua',
     slv: 'Erdogan in "prijatelj" Putin zagnala gradnjo jedrske elektrarne' },
  summary: 
   { eng: 'Leaders of Russia, Turkey and Iran to hold talks to end the conflict amid rapid developments on the ground.\n\nTurkey will host a trilateral meeting on the Syrian crisis with the attendance of presidents of Turkey, Russia and Iran on Wednesday amid significant developments happening on the ground in the seven-year civil war.\n\nRussian President Vladimir Putin arrived in Ankara on Tuesday, followed by Iranian President Hassan Rouhani in the evening, as the leaders meet for the second time since Novem',
     deu: 'Beim ersten Auslandsbesuch seit seiner Wiederwahl im Mrz einigte sich Wladimir Putin mit dem trkischen Prsidenten Recep Tayyip Erdogan auf eine Ausweitung der wirtschaftlichen sowie militrischen Zusammenarbeit. Auch der Bau des AKW Akkuyu hat begonnen.\n\nAuf einer Pressekonferenz in Ankara kndigte Putin an, dass Russland seine Liefertermine fr die S-400-Verteidigungssysteme, die gem einem bereits unterzeichneten Vertrag zwischen beiden Lndern ursprnglich fr Dezember avisiert ',
     rus: '            "",  Anadolu.\n\n ,           .\n\n  ,     ',
     fra: 'Les prsidents turc, russe et iranien ont plaid pour un "cessez-le-feu durable" en Syrie,  l\'issue d\'un sommet qui les a runis au Palais prsidentiel,  Ankara, selon le communiqu publi  l\'issue de la runion. Une fois cet objectif affich, les dclarations des trois chefs d\'Etat lors de leur confrence de presse commune indiquaient que chacun poursuivait ses propres obsessions. Recep Tayyip Erdogan a rpt l\'quivalence, selon lui, entre les terroristes de l\'Etat islamiqu',
     spa: 'De pie, en el palacio presidencial en Ankara, el presidente de Turqua Recep Tayyip Erdogan orden este martes el comienzo de la construccin de Akkuyu, la primera planta de energa nuclear en su pas.\n\nA su lado estaba Vladimir Putin, presidente de Rusia, de donde es originaria la empresa Rosatom, principal constructora de este complejo que costar ms de US$20.000 millones.\n\nA travs de una pantalla de video, ambos vieron como a unos 500 kilmetros de ah, en la regin de Mersin cerc',
     slv: 'Ruski predsednik Vladimir Putin je priel v Turijo na vrh za reitev sirske vojne, e prej pa se je sreal s turkim kolegom Recepom Tayyipom Erdoganom.\n\nPredsednika sta slovesno zagnala gradnjo prve jedrske elektrarne v Turiji, ki jo je zael snovati ruski velikan Rosatom. Putin je stal ob Erdoganu, ko je ta iz predsednike palae v Ankari po videopovezavi odredil zaetek gradnje jedrske elektrarne v Akkuyu na jugu drave. Delavci so takoj zaeli vlivati beton na gradbiu. Grad' },
  location: 
   { type: 'place',
     label: { eng: 'Ankara' },
     country: { type: 'country', label: [Object] } },
