  eventDate: '2018-03-19',
  title: 
   { eng: 'Last male northern white rhino dies',
     spa: 'Muere Sudn, el ltimo rinoceronte blanco del norte macho que quedaba en el mundo',
     deu: '\'Sudan\': Letztes mnnliches nrdliches Breitmaulnashorn der Welt ist in Kenia gestorben',
     fra: 'La mort de Sudan condamne l\'espce des rhinocros blancs du Nord',
     rus: '  . ',
     por: 'Morreu o ltimo rinoceronte-branco-do-norte macho',
     ita: 'Kenya: morto ultimo rinoceronte bianco settentrionale maschio',
     hrv: 'Uginuo je Sudan: Cijela vrsta ostala je samo na dvije enke',
     slv: 'Uspavali zadnjega samca severnega belega nosoroga' },
  summary: 
   { eng: 'The world\'s last surviving male northern white rhino has died after months of ill health, his carers said.\n\nSudan, 45, lived at the Ol Pejeta Conservancy in Kenya. He was put to sleep on Monday after age-related complications worsened significantly.\n\nHis death leaves only two females - his daughter and granddaughter - of the subspecies alive in the world.\n\nHope for preserving the northern white rhino now lies in developing in vitro fertilisation (IVF) techniques.\n\nRhinoceroses - of which there ar',
     spa: 'El ltimo rinoceronte blanco del norte macho del mundo muri este lunes tras meses de enfermedad, dijeron sus cuidadores.\n\nSudn, como se llamaba el ejemplar, tena 45 aos y viva en la reserva Ol Pejet, en Kenia.\n\nFue sacrificado el lunes despus de que sus complicaciones relacionadas con la edad empeoraran considerablemente.\n\nSu muerte deja solo dos rinocerontes hembras de su subespecie en el mundo: su hija y su nieta.\n\nEl rinoceronte, cuya edad era equivalente a los 90 aos de los ser',
     deu: 'Das letzte mnnliche Nrdliche Breitmaulnashorn der Welt war oft zu schwach, um umher zu laufen. Leise schnaufend lag Sudan im Schatten in seinem Gehege in einem Wildtierreservat in Kenia. Seine Ohren drehten sich wie kleine Satellitenschsseln in alle Richtungen, wohl neugierig, was der ganze Trubel um ihn herum soll. Immer wieder hob er seinen groen Kopf mit den zwei Hrnern, die so viele seiner Artgenossen das Leben gekostet haben. Im hohen Alter von 45 Jahren ist Sudan - genannt nach de',
     fra: 'Le dernier rhinocros blanc du Nord mle est mort au Kenya lundi 19 mars. Victime du braconnage, cette espce est condamne puisqu\'il ne reste plus dsormais que deux femelles en vie sur la plante.\n\n"Il fut un illustre ambassadeur de son espce. Pour tout ce qu\'il a accompli pour sensibiliser le monde au triste sort des rhinocros, mais aussi  celui des milliers d\'autres espces menaces d\'extinction  cause des activits humaines, Sudan laissera un souvenir imprissable."\n\nCit ',
     rus: '         \n\n-. 19  2018                  .   45 .\n\n  ,     ',
     por: 'A sade de Sudan, de 45 anos, piorou significativamente nas ltimas horas, pelo que a equipa da reserva natural onde vivia decidiu abat-lo.\n\nSudan, o ltimo rinoceronte-branco-do-norte macho, morreu nesta segunda-feira aos 45 anos. A informao foi avanada pela reserva natural queniana de Ol Pejeta, onde o animal vivia desde 2009. Com a sade de Sudan a deteriorar-se de dia para dia, a reserva natural tomou a deciso de abat-lo, conforme explica em comunicado. Agora h apenas duas f',
     ita: 'LONDRA - Era l\'ultimo esemplare maschio al mondo di rinoceronte bianco settentrionale: Sudan  morto a 45 anni. L\'animale, malato da tempo, non ha superato, a causa dell\'et avanzata, alcune complicazioni mediche.\n\nIl rinoceronte, che viveva insieme ad altre due femmine anziane della stessa specie nella riserva di Ol Pejeta Conservancy in Kenya,  stato addormentato definitivamente luned dopo che le sue condizioni si erano ulteriormente aggravate.\n\n stata la stessa riserva ad annunciare la',
     hrv: 'Sudan, posljednji mujak sjevernog bijelog nosoroga, uginuo je u ponedjeljak nakon to se mjesecima borio sa zdravstvenim komplikacijama zbog starosti. Imao je 45 godina.\n\nNjegovi skrbnici iz Kenije objavili su ga kako su ga morali uspavati nakon to mu se znaajno pogoralo stanje. Zbog degenerativnih promjena u miiima i kostima te rana na koi Sudan vie nije mogao ni stajati.\n\nTHOMAS MUKOYA/REUTERS/PIXSELL/REUTERS/PIXSELL\n\nOd cijele podvrste ovih nosoroga ostale su sada samo dvije ',
     slv: 'Nosoroga Sudana so e dlje asa zdravili zaradi razlinih s starostjo povezanih teav. V zadnjih 24 urah pa se je njegovo zdravstveno stanje zelo poslabalo, saj ni mogel niti vstati in je zelo trpel. Tako se je veterinarska ekipa odloila, da ga raje uspavajo. Drugi samec te podvrste je poginil e oktobra leta 2014.\n\n"Sudan je bil zadnji severni beli nosorog, ki se je skotil v divjini. Njegova smrt je krut simbol loveke brezbrinosti za naravo in je razalostila vse, ki so ga poznal' },
