  title: 
   { eng: 'Zlatan Gives The Most Zlatan Interview After Dream Debut',
     fra: 'LA Galaxy: Ibrahimovic entre... et marque (dj) un but d\'anthologie !',
     spa: '\'Le pegu as porque no quera correr\'; Zlatan explic golazo en debut',
     por: 'Ele est com fome: Ibrahimovic faz golao e garante virada do Galaxy no drbi de LA',
     deu: 'Zlatan Ibrahimovic gibt MLS-Debt fr LA Galaxy mit Traumtor',
     rus: '       33 ',
     hrv: 'Uao kod 1-3, zabio volej s 40 metara pa glavom za pobjedu!',
     tur: 'Zlatan Ibrahimovic ilk manda nefis goller',
     ita: 'Ibrahimovic ha gi conquistato la MLS' },
  summary: 
   { eng: 'Zlatan Ibrahimovic had the dream LA Galaxy debut and had the perfect post-match interview to go with it.\n\nWith his new team 3-1 down to an Carlos-Vela inspired Los Angeles, the charismatic Swede entered the fray as a substitute in the 71st minute.\n\nChris Pontius struck a minute later to bring the scoreline to 3-2 and then Zlatan did his thing.\n\nThe 36-year old bagged an insane looping half-volley to equalise and couldn\'t contain his emotion, whipping off his shirt and celebrating wildly.\n\nHe wasn',
     fra: 'Zlatan Ibrahimovic a sign son arrive en MLS en inscrivant un premier but fantastique samedi dans le derby californien entre son club, le Los Angeles Galaxy, et le Los Angeles FC. Le Sudois,  peine entr en jeu, a galis  3-3 d\'un superbe tir lob lointain. Et  quelques secondes du coup de sifflet final, il a inscrit le but de la victoire. Splendide!\n\nLa conqute de l\'Amrique dmarre sur les chapeaux de roue pour Zlatan Ibrahimovic! Arriv jeudi en Californie, prsent vend',
     spa: 'Los ngeles, California, EE.UU. (AFP) -\n\nTan claro y frontal como siempre ha sido, Zlatan Ibrahimovic explic cmo fue que pens el golazo que anot en el partido de Los Angeles Galaxy este sbado frente al LAFC, en el que su equipo remont para ganar 4-3 con dos dianas suyas.\n\nLa estrella sueca dijo que el clima insoportable le llev a tomar la decisin de disparar de media cancha para "no correr y no gastar energa".\n\n"Siento que jugu 40 partidos en estos 20 minutos. Fue por culpa d',
     por: 'Ele avisou que estava com fome. Mas ningum tinha ideia do quo faminto o leo estava. Com pouco mais de 20 minutos em campo, Ibrahimovic fez dois gols, um deles de quase do meio-campo, garantiu a vitria por virada do LA Galaxy por 4 a 3 aps ver o LA FC abrir 3 a 0 e foi a figura do primeiro drbi de Los Angeles da histria (assista abaixo ao dois gols do craque).\n\nIbrahimovic estreia pelo LA Galaxy com golao\n\nMenos de 48 horas depois de desembarcar nos EUA, Zlatan Ibrahimovic comeou',
     deu: 'Zlatan Ibrahimovic debtiert in der MLS fr LA Galaxy und sorgt nach seiner Einwechslung fr die Wende zu Gunsten der LA Galaxy und lsst die Fans jubeln.\n\nZlatan Ibrahimovic hat in der MLS fr die LA Galaxy ein Traum-Debt gefeiert.\n\nDer Schwede wurde in seiner ersten Partie fr Galaxy im Stadtderby gegen Los Angeles FC in der 71. Minute beim Stand von 1:3 aus Sicht von Galaxy eingewechselt. Zwei Minuten spter gelang dem Team des Schweden der 2:3-Anschlusstreffer in Person von Chris Pon',
     rus: 'lagalaxy / Instagram\n\n               (MLS) "- ".    Instagram- .\n\n 77-     "-"     ',
     hrv: 'uo sam da viu \'elimo Zlatana\', pa sam im dao Zlatana, rekao je Zlatan Ibrahimovi nakon debija za Los Angeles Galaxy u kojem je napravio neto to samo on moe.\n\nPrilagodba? Ma moete takvu rije do sutra traiti u Zlatanovu rjeniku, neete je pronai. Nakon samo jednog treninga, Ibrahimovi je debitirao i - dominirao. Nisu veani bezveze stavili rije \'zlataner\' u rjenik, a ona znai upravo - dominacija.\n\nUao je u igru u 71. minuti, Los Angeles Galaxy gubio je 3-1 od L',
     tur: 'Los Angeles Galaxy formas giyen Ibrahimovic, kt ilk mata enfes bir gole imza att. Takmnn 3. ve 4. goln kaydeden Ibrahimovic, taraftarlarna \'ben buradaym\' mesaj verdi.\n\nAmerikan Birinci Futbol Ligi (MLS) takmlarndan Los Angeles Galaxy\'e transfer olan Zlatan Ibrahimovic, kt ilk mata iki gol atarak takmna galibiyeti getirdi.\n\nGetiimiz gnlerde Manchester United\'dan ABD\'nin Los Angeles Galaxy takmna transfer olarak futbol dnyasnda by',
     ita: 'Lo svedese ha commentato il suo debutto da urlo nel campionato statunitense, condito da una doppietta che ha portato i Galaxy alla vittoria: " stato fantastico".\n\nZlatan Ibrahimovic ha gi messo le mani sulla Major League Soccer. Il centravanti svedese ieri ha debuttato nel campionato statunitense con la maglia dei Los Angeles Galaxy e ha fatto capire a tutti quanti che ora c\' un nuovo sceriffo in citt.\n\nL\'ex giocatore del Manchester United  entrato al 71esimo minuto, quando il risultato' },
