  eventDate: '2018-04-14',
  title: 
   { eng: 'SpaceX to Launch NASA\'s Exoplanet-Hunting Spacecraft Today: How to Watch Live',
     fra: 'Le tlescope spatial TESS va scruter les exoplantes  la recherche d\'une vie extraterrestre',
     spa: 'Lanzado con xito el nuevo buscador de mundos habitables TESS',
     deu: '"Tess": Neues Nasa-Weltraumteleskop gestartet - SPIEGEL ONLINE - Wissenschaft',
     zho: 'NASA  |  |  | ',
     por: 'NASA lanar novo telescpio em busca da Terra 2.0',
     rus: 'NASA     ' },
  summary: 
   { eng: 'After a delay, SpaceX is winding up again to launch NASA\'s Transiting Exoplanet Survey Satellite (TESS) today (April 18) from Cape Canaveral Air Force Station in Florida.\n\nThe 30-second launch window of SpaceX\'s Falcon 9 rocket is set for 6:51 p.m. EDT (2251 GMT), and you can watch the launch live on Space.com\'s home page, courtesy of NASA TV. After launch, the rocket\'s first stage is set to attempt a landing on the SpaceX drone ship Of Course I Still Love You.\n\nAfter it reaches space, TESS will ',
     fra: 'Sommes-nous seuls dans l\'Univers? La Nasa doit lancer dans la nuit de lundi  mardi son nouveau tlescope spatial  la recherche de plantes d\'une taille comparable  celle de la Terre, et susceptibles - peut-tre - d\'abriter la vie. Le Transiting Exoplanet Survey Satellite (TESS) doit tre propuls dans l\'espace  18h32 (0h32 GMT+2) par une fuse Falcon 9 de SpaceX depuis Cap Canaveral, en Floride.\n\nD\'un cot de 337 millions de dollars, cet engin de la taille d\'une machine  laver au',
     spa: 'MADRID, 19 Abr. (EUROPA PRESS) -\n\nEl nuevo buscador de mundos habitables TESS (Transiting Exoplanet Survey Satellite) de la NASA ha sido lanzado con xito desde Cabo Caaveral (Florida) a bordo de un cohete Falcon 9 de Space X.\n\nEl despegue se produjo con dos das de retraso, a las 22.51 GMT del 18 de abril, por la decisin de llevar a cabo "anlisis adicionales de control de navegacin" tras detectarse un problema tcnico.\n\nEl objetivo de esta nueva misin de la NASA ser encontrar mund',
     deu: 'Das neue Weltraumteleskop "Tess" - kurz fr "Transiting Exoplanet Survey Satellite" - ist auf dem Weg zu seinem Einsatzort. "Tess" habe in der Nacht zum Donnerstag erfolgreich an Bord einer "Falcon 9"-Rakete des privaten Raumfahrtunternehmens SpaceX vom Weltraumbahnhof Cape Canaveral im US-Bundesstaat Florida abgehoben, teilte die US-Raumfahrtbehrde Nasa mit. Die erste Raketenstufe landete anschlieend auf einer schwimmenden Raketenplattform im Atlantik und soll wiederverwendet werden.\n\n"Tess',
     zho: 'NASA33700\n\nTESS63222329SpaceX Falcon 9Cape Canaveral\n\nTESS',
     por: 'Descobrir o que habita o espao extraterrestre  curiosidade de muita gente. E, para alegria dos interessados, a NASA no brinca em servio. A nova empreitada da agncia  o lanamento de um caador de planetas, com a misso de encontrar a Terra 2.0. Isso mesmo: o novo telescpio ser enviado  rbita e vasculhar o espao para identificar planetas jamais catalogados.\n\nO brinquedinho da agncia norte-americana atende pelo nome de TESS e  poderoso para cumprir com louvor a sua mi',
     rus: '       .\n\nTESS    200    NASA\n\n , 16 , NASA   TESS (Transiting Exoplanet Survey Satellite),           , ' },
