  title: 
   { eng: 'Saudi Arabia intercepts missile over capital city',
     fra: 'Ymen: Jean-Yves Le Drian assume les ventes d\'armes franaises et accuse l\'Iran',
     zho: '  - ',
     deu: 'Saudi-Arabiens Rolle im Krieg: Der Jemen am Abgrund',
     spa: 'Arabia Saudita intercepta siete misiles que, asegura, fueron disparados desde Yemen',
     tur: 'Suudi Arabistan\'a balistik fze saldrs: 1 l, 2 yaral',
     rus: '"  "',
     por: 'Arbia Saudita intercepta msseis disparados do Imen sobre Riad (VDEOS)',
     ita: 'Missili degli Houthi su Riad, un morto' },
  summary: 
   { eng: 'Chat with us in Facebook Messenger. Find out what\'s happening in the world as it unfolds.\n\n(CNN)Saudi Arabia\'s air force intercepted a missile over Riyadh on Sunday, according to an official with the country\'s Ministry of Information.\n\nAuthorities have not said who is behind the missile attack. Saudi Arabia has been leading a coalition of states against Iran-backed Houthi rebels in Yemen, who toppled that country\'s internationally recognized government in 2015.Between November and December of las',
     fra: 'Jean-Yves Le Drian tait interrog ce jeudi 29 mars sur la radio RTL sur la situation au Ymen et notamment les ventes d\'armes franaises  l\'Arabie saoudite qui intervient militairement dans le pays. Le ministre des Affaires trangres a dfendu la position de la France dans ce conflit et point la responsabilit de l\'Iran dans l\'armement des rebelles houthis.\n\nPour plusieurs organisations non gouvernementales, la population ymnite est depuis trois ans rgulirement bombarde pa',
     zho: '2018032625Houthi\n\n',
     deu: 'Als Saudi-Arabien vor drei Jahren erstmals Luftangriffe gegen die Houthi-Miliz im Jemen geflogen hatte, war in der Hauptstadt Riad die Erwartung gro, dass der Krieg rasch beendet sein wrde. Seither hat Saudi-Arabien aber keines seiner Ziele erreicht. So ist das Knigreich heute nicht sicherer als im Mrz 2015. Denn die Houthis, die 2014 im Jemen die Macht bernommen hatten, feuern heute mehr Raketen denn je nach Saudi-Arabien ab. Allein in den vergangenen Tagen hat die saudische Luftabwehr',
     spa: '(CNN) - La Fuerza Area de Arabia Saudita intercept siete misiles disparados desde Yemen este domingo. Un hombre muri cuando los escombros de los misiles interceptados cayeron en un suburbio residencial, dijeron los saudes en un comunicado.\n\nEl portavoz de las Fuerzas de la Coalicin, el coronel Turki Al Maliki, dijo que los misiles fueron disparados desde Yemen a cuatro reas objetivo y que todos los misiles fueron interceptados y destruidos, segn un comunicado.\n\nEsta no es la primera',
     tur: 'Sivil Savunma\'nn Riyad blgesindeki basn szcs Muhammed el-Hamadi, Yemen\'den bakente frlatlan balistik fzelerin havada imha edildiini ancak paralarnn bakentin farkl yerleim yerlerine dtn belirtti.\n\nHamadi, paralarn, Msr uyruklu kiilerin oturduu bir eve dmesi sonucu 1 kiinin yaamn yitirdii, 2 kiinin yaraland bilgisini paylat.\n\nSuudi Arabistan\'a balistik fze saldrs\n\nBu arada Suudi Arabistan nclndeki ',
     rus: ':     \n\n        ,      --      . ,   ,  ',
     por: 'A Fora Area saudita interceptou um mssil disparado do Imen em direo  parte nordeste de Riad na noite deste domingo, segundo relatos da mdia local.\n\nVrias testemunhas, incluindo jornalistas da Agncia Reuters, relataram ter ouvido vrios estrondos e flashes no cu pouco antes da meia-noite na capital saudita.\n\nImagens ainda no verificadas, que surgiram online, mostram uma suposta exploso no meio do ar do interceptador de vrios ngulos.\n\nAlhumdillah The saudi army has su',
     ita: 'I ribelli Houthi dello Yemen hanno lanciato questa notte almeno sette missili balistici su Riad e altre citt dell\'Arabia saudita. Tre ordigni sono stati intercettati dal sistema di difesa Patriot prima che colpissero la capitale. I frammenti di uno dei missili, secondo il governo di saudita, hanno ucciso una persona, e ci sarebbero anche feriti. Un filmato mostra uno dei missili Patriot lanciati per intercettare la minaccia deviare dalla rotta e schiantarsi al suolo in una tremenda esplosione.\n' },
