     fra: 'Le dirigeant nord-coren a annonc la fin des essais nuclaires estimant que "la mission tait remplie". Donald Trump a salu les "progrs" de la Core du Nord.\n\nLa Core du nord a pris une dcision spectaculaire en annonant samedi la fin des essais nuclaires et des tests de missiles intercontinentaux ainsi que la fermeture du site d\'essais nuclaires, une dcision aussitt salue par Washington et Soul mais juge insatisfaisante par Tokyo.\n\n"A partir du 21 avril, la Core du',
